import React, { Component } from "react";

export class MainHeader extends Component {
  render() {
    const headerStyle = {
      background: "#5e438d",
      color: "#fff",
      textAlign: "center",
      padding: "10px",
    };
    return (
      <header style={headerStyle}>
        <h1>Newsletter</h1>
      </header>
    );
  }
}

export default MainHeader;
